&quot;Malcolm Little was born in Omaha, Nebraska in May of 1925.  After an early life of crime and seven years in prison, he changed his name to Malcolm X and changed the world with his fiery oratory centering on race and the Nation of Islam.  Here on two amazing CDs are the most dynamic and vibrant speeches Malcolm X gave before being felled by assassins in 1965.&quot;


note:  every effort was made (by me, ripping these CDs) to get the best balance of audio quality and bitrate and file size.  the audio quality of the original files are shitty, and i ripped these about four times before deciding on this bitrate (112 mono 32kHz).  the content of these speeches is HIGHLY inflammatory and, as such, HIGHLY recommended by me!

